column8:
（年式）２００８年５月～（平成２０年５月～）<br>
　　　マイナーチェンジ前後共通<br><br>

フリードのセカンドシートの足元フロアーが大変狭いためにお悩みの方、解決グッズができました！！<br><br>

５，７，８人乗りベンチ、セカンドシートを約９０ｍｍ後方へ移動させるキットが発売されました♪<br><br>

６，７人乗りキャプテン、セカンドシートは約130ｍｍ後方へ移動出来ます。<br><br>

装着することによりセカンドシートのフットスペースが拡大し且フロントシートがフラットに出来ます!!<br><br>

やはり、セカンドシートはラグジュアリーな気分で♪<br><br>

＊マイナーチェンジ車（２００９年）のお車は少しだけセカンドシートが後方に移動しておりますがフラットにならず足元が思ったほど広くありません。本商品はマイナーチェンジ後のお車も対応しております。<br>
マイナーチェンジ車もフラットになります。<br><br>

＊５人乗り・７人乗り・８人乗りベンチシート用　（本体、付属パーツ入り）<br>
＊６人乗り・７人乗りキャプテンシート用　（本体、付属パーツ入り）<br>
　 ハイブリッド車に対応しています。<br><br>






※こちらの商品は国内大手シートフレーム製造会社で<br>
　製作されているノーブランド商品です。<br>
※国産品で大変人気の商品です！！<br>
　品質は当店が保証いたします。<br><br>

